contact.css.keyStrokeInfo:
/* contact form */
input,textarea { 
    border: none;
    border-bottom: 0.1px solid rgb(104, 104, 101);
    padding: 15px;
    transition: 0.4s ease all;
    width: 40%;
    background-color: black;
  }
  
  input:focus{
      outline: none;
      border-bottom: 2px solid yellow;
  }
  
  input:hover {
    border-bottom: 2px solid yellow;
  }
  textarea:focus{
      outline: none;
      border-bottom: 2px solid yellow;
  }
  
  textarea:hover {
    border-bottom: 2px solid yellow;
  }
